import './App.css';
import officeLogo from './imagenes/office-logo.png';

function App() {
  return (
    <div className="aplicacion-tareas">
     <div className='office-logo-contenedor'>
        <img src={officeLogo} className='office-logo'/>  
     </div>
    </div>
  );
}

export default App;

